import React from "react";

const Social = () => {
    return (
        <div className="home__social">
            <a href="https://linkedin.com"
                className="home__social-icon"
                target="blank">
                    <i class="ui uil-linkedin"></i>
                </a>
                <a href="https://linkedin.com"
                className="home__social-icon"
                target="blank">
                    <i class="ui uil-internet"></i>
                </a>

        </div>
    )
}

export default Social;
